# 安装


```bash
npm i san@latest san-ssr@latest
```


san-ssr 需要 san 提供的模板字符串解析和 TypeScript 类型，因此对 san 的版本有依赖。你需要安装对应版本的 san 和 san-ssr。

san-ssr 支持的 san 版本声明在 `peerDependencies` 里，因此只要能安装成功就能正确工作。一般的建议如下：

- 如果是新项目，建议使用 `npm i san@latest san-ssr@latest`

- 否则从 san-ssr 最新版本开始降主版本号找到能安装成功的版本。

> 更多讨论请参考：[baidu/san/issues/441](https://github.com/baidu/san/issues/441#issuecomment-550260372)

# 渲染一个 San 组件

```javascript
const { SanProject } = require('san-ssr')
const san = require('san')
const MyComponent = san.defineComponent({
    template: `<div>Hello {{ name }}</div>`
})

// SanProject 类提供了你会用到的所有接口
const project = new SanProject()

// 输入是组件对象
// 输出是一个 render 函数。该函数接受数据对象作为参数，返回 HTML 字符串。
const render = project.compileToRenderer(MyComponent)

const html = render({name: 'San'})
```



参考内容：

- API 文档：[SanProject][sanproject]
- /demo 下的示例项目。


[sanproject]: https://baidu.github.io/san-ssr/classes/_src_models_san_project_.sanproject.html

从名字即可看出，将组件传入 `compileToRender` 得到 render 函数是一个编译过程，需要一定的编译时间。

这一编译过程只会进行一次，后续渲染可以直接使用 render 函数。但如果对启动时间比较介意，可以在线下对 San 组件进行预编译。

使用 San-SSR 提供的 `compileToSource` 方法可以得到 render 函数的字符串版本：

```javascript
const { SanProject } = require('san-ssr')
const fs = require('fs')
const path = require('path')
const san = require('san')

let MyComponent = san.defineComponent({
    template: "<div>Hello {{ name }}</div>"
})

const project = new SanProject()

// 得到的是 render 函数文件内容
const renderStr = project.compileToSource(MyComponent)

fs.writeFileSync(path.resolve(__dirname, 'output.js'), renderStr)


// 在服务器端执行以下代码进行渲染
const render = require('./output.js')
const html = render({name: 'San'})
```

在之前的示例中，传入 `SanProject` 的内容为组件类：

```javascript
const { SanProject } = require('san-ssr')
const san = require('san')
const MyComponent = san.defineComponent({
    template: `<div>Hello {{ name }}</div>`
})

// SanProject 类提供了你会用到的所有接口
const project = new SanProject()

// 输入是组件对象
// 输出是一个 render 函数。该函数接受数据对象作为参数，返回 HTML 字符串。
const render = project.compileToRenderer(MyComponent)

const html = render({name: 'San'})
```

事实上，San-SSR 支持三种输入，分别为组件类、JavaScript 文件路径与 TypeScript 文件路径：

```javascript
// app.js
const san = require('san')
let MyComponent = san.defineComponent({
    template: "<div>Hello {{ name }}</div>"
})
exports = module.exports = MyComponent
```

```javascript
// index.js
const { SanProject } = require('san-ssr')
const fs = require('fs')
const path = require('path')

const project = new SanProject()

// 此时传入的是一个文件路径
// 得到的是 render 函数文件内容
const renderStr = project.compileToSource(require.resolve('./app.js'))
// const renderStr = project.compileToSource(require.resolve('./app.ts'))

fs.writeFileSync(path.resolve(__dirname, 'output.js'), renderStr)


// 在服务器端执行以下代码进行渲染
const render = require('./output.js')
const html = render({name: 'San'})
```

# compileToRender 与 compileToSource

- compileToRender 只支持输入组件类。
- compileToSource 支持输入组件类、JavaScript 文件路径以及 TypeScript 文件路径。

# 区别

根据不同的输入，San-SSR 的行为是不同的。

## 输入为组件类时

此时 San-SSR 接收到的是已经在内存中的类，组件的 template、components 等信息可以直接在类上通过属性读取。

优点：

- 可以通过递归的方式遍历整个组件树。
- 获取到的是代码执行后的结果，San-SSR 对于组件的写法是无感的。

缺点：

- San-SSR 并不知道当前类及其子组件所对应的文件信息，也就是“不知道这些组件类是从哪里来的”。
- 当使用 compileToSource 时，San-SSR 需要尝试将内存中的类转换为字符串定义，有一定局限性。
- 由于需要将组件加载到内存中，因此可能在线下编译阶段执行组件代码，其依赖必须完备（仅仅是为了 require 不报错）。

## 输入为文件路径时

此时 San-SSR 会尝试读取文件内容，其输入是组件文件的字符串，组件的 template、components 等信息需要通过静态分析的方式获取哦。

优点：

- San-SSR 知道组件的明确路径。
- San-SSR 知道组件定义文件内容。
- 可以单文件编译，不需要加载完整的组件树。

缺点：

- 组件写法需要相对固定，过于复杂时，无法通过静态分析获取到 template、components 等信息。

目前 San-SSR **只支持以组件类作为输入**进行编译。

假设有以下组件：

```javascript
// app.js
const { connect } = require('san-store')
const san = require('san')

const MyComponent = connect.san({
    'name': 'text'
})(san.defineComponent({
    template: "<div>{{ name }}</div>"
}))

module.exports = MyComponent
```

# compileToRender

```javascript
const { SanProject } = require('san-ssr')
const { connect, store } = require('san-store')
const san = require('san')

const MyComponent = require('./app.js')

store.raw = {text: 'san'}

const project = new SanProject()
const render = project.compileToRenderer(MyComponent)
const html = render({name: 'San'})
```

# compileToSource

当 `compileToSource` 时，必须配合[手动传入组件类进行-render](/pages/Guides/use-outside-component.html)特性来使用。

编译阶段：
```javascript
// compile
const { SanProject } = require('san-ssr')
const { store } = require('san-store')
const fs = require('fs')
const path = require('path')

const MyComponent = require('./app')
const project = new SanProject()
const renderStr = project.compileToSource(MyComponent, 'js', {
    useProvidedComponentClass: true
})
fs.writeFileSync(path.resolve(__dirname, './output.js'), renderStr)
```

渲染阶段：
```javascript
// render
const { store } = require('san-store')

const MyComponent = require('./app')
const render = require('./output')
store.raw = {text: 'san'}
const html = render({name: 'San'}, {
    ComponentClass: MyComponent
})
```

有时我们希望在线上执行阶段使用不同的组件。例如有两个版本的组件库，希望通过抽样变量决定使用其中的某个版本。

San-SSR 提供了 `customSSRFilePath` API 来支持上述场景。

# 编译阶段

1. 输入为代码字符串

    此时不需要其他额外操作。

2. 输入为组件 Class

    由于我们需要提前 require 组件代码得到 Class， 之后传入 San-SSR 进行编译，因此需要使用 [markExternalComponent](./使用-markExternalComponent-特性进行编译.md) 特性提前标记出外部组件。

# 运行阶段

在调用 render 函数进行渲染时，传入 `customSSRFilePath`：

```javascript
const render = require('./output')

const html = render({}, {
    parentCtx: {
        context: {
            customSSRFilePath ({ specifier, id, tagName }) {
                if (specifier.endsWith('childA.san')) {
                    return specifier.replace('childA', 'childB')
                }
            }
        }
    }
})
```

# 使用编译产出的组件类存在的问题

在 ssr 过程中，模板可能需要读取组件实例上的属性或方法，因此我们需要在每次渲染时创建组件的一个实例。

当编译输出字符串时，会有以下问题：

- 当输入为 JavaScript 或 TypeScript 时，San-SSR 会将组件类的字符串定义直接输出在产物中，之后在渲染阶段根据这些类创建组件实例。当组件书写方式过于复杂时，解析可能会失败。
- 当输入为 Class 时，San-SSR 会尝试将内存中的类字符串化。该方法只能输出组件自身内容，如果组件类引用了外部变量等，执行阶段会报错。

编译输出为 render 函数时，则可以避免上述问题。

基于以上，San-SSR 提供了在执行阶段手动传入组件 Class 进行渲染的能力，此时编译产物中不会含有组件类代码，San-SSR 的产物与组件代码需要一起上到线上执行。

# 使用方式

## 编译阶段

```typescript
const MyComponent = require('./component')
const sanProject = new SanProject()
const res = sanProject.compileToSource(MyComponent, 'js', {
    useProvidedComponentClass: true
})

fs.writeFileSync(path.resolve(__dirname, './output.js'), res)
```

## 线上执行

只需传入根组件即可

```typescript
const Component = require('./component')
const render = require('./output')

const html = render({}, { ComponentClass: Component })
```

# 与 markExternalComponent 特性配合使用

当与 [markExternalComponent](./使用-markExternalComponent-特性进行编译.md) 配合使用时，由于定义外部组件引用的 specifier 为组件类文件，我们需要使用 [customSSRFilePath](./渲染阶段自定义组件路径.md) 来帮助 San-SSR 找到外部组件所对应的 San-SSR 产物位置：

```javascript
const Component = require('./component')
const render = require('./output')

const html = render({}, {
    ComponentClass: Component,
    parentCtx: {
        context: {
            customSSRFilePath ({ specifier }) {
                if (specifier.endsWith('childA.san')) {
                    return specifier + '.ssr'
                }
            }
        }
    }
})
```

如果我们想要完全改变子组件的路径，则可以再配合 `customComponentFilePath` 方法，替换所使用的子组件类：

```javascript
const Component = require('./component')
const render = require('./output')

const html = render({}, {
    ComponentClass: Component,
    parentCtx: {
        context: {
            customSSRFilePath ({ specifier, id, tagName }) {
                if (specifier.endsWith('childA.san')) {
                    return specifier + '.ssr'
                }
            },
            customComponentFilePath ({ specifier, id, tagName }) {
                if (specifier === './childA.san') {
                    if (tagName === 'x-b') {
                        return path.resolve(__dirname, './childB.san')
                    }
                    return path.resolve(__dirname, './childA.san')
                }
            },
        }
    }
})
```

# San-SSR 输入的三种类型

目前 San-SSR 在进行编译时，输入的类型有三种，分别为：

1. Class

```javascript
const {compileToSource} = require('san-ssr')
const MyComponent = require('path/to/mycomponent')
compileToSource(MyCompoent)
```

2. JavaScript string

```javascript
const {compileToSource} = require('san-ssr')
const fs = require('fs')
const MyComponentStr = fs.readFileSync('path/to/mycomponent.js', 'utf-8')
compileToSource(MyCompoentStr)
```

3. TypeScript string

```javascript
const {compileToSource} = require('san-ssr')
const fs = require('fs')
const MyComponentStr = fs.readFileSync('path/to/mycomponent.ts', 'utf-8')
compileToSource(MyCompoentStr)
```

由于输入 JavaScript 或 TypeScript 源码的形式，需要对输入字符串进行静态分析，因此不适合组件写法过于灵活过的情况。而以 Class 形式作为输入则可以解决上述问题。

# Class 作为输入存在的问题

当使用 Class 作为输入时，我们需要在编译阶段直接 require 该组件，因此所有依赖（子组件、工具库等）此时都需要是可被引用到的。

由于我们的组件可能分布于多个代码库，因此大多数情况下只能在生产环境中进行组件的编译工作。markExternalComponet 的引入就是为了解决该问题。

基于 San-SSR 最新提供的 markExternalComponet 特性，我们可以在本地进行组件的编译工作。

# 快速上手

## markExternalComponent

新版本的 San-SSR 中，提供了一个 `markExternalComponent` 函数，使用该函数，可以提前标记外部组件。

假设我们有这样一个组件：

```javascript
const san = require('san')
const Child = require('./childA.san')

const MyComponent = san.defineComponent({
    components: {
        'x-l': Child
    },
    template: '<div><x-l/></div>'
})

module.exports = MyComponent
```

其中 childA 组件不在当前代码库中，它可能是一个单独维护的组件库等。此时我们可以在引用该组件类进行编译之前，对 `childA` 进行标记：

```javascript
markExternalComponent({
    isExternalComponent (specifier) {
        if (specifier === './childA.san') {
            return true
        }
        return false
    }
})
const {compileToSource} = require('san-ssr')
const MyComponent = require('path/to/mycomponent')
compileToSource(MyCompoent)
```

进行标记后，当我们 require `MyComponent` 时，将不会去加载 `childA`，我们可以在生产环境中单独提供 `childA`。

## 组件 id

当我们从文件中引用一个组件时，需要两个信息来定位一个组件：

1. `specifier`：表示组件所在文件的路径，运行时会使用 `require(specifier)` 来加载该文件。因此它可以是一个相对路径、绝对路径或一个包名称。
2. `id`：表示某个文件中的组件 id。

例如：

```javascript
// specifier 为 './childA.san'，id 为 ‘default’
const Child = require('./childA.san')
```

```javascript
// specifier 为 'some-ui-module'，id 为 'compA' 和 'compB'
const { compA, compB } = require('some-ui-module')
```

当我们使用 `markExternalComponent` 时，**需要手动对子组件的 id 进行标记**，否则 san-ssr 会默认以递增数字的形式对 id 进行命名。

例如：

```javascript
const san = require('san')

const OtherComponent = san.defineComponent({
    id: 'default', // id 标记
    template: '<div></div>'
})

module.exports = OtherComponent
```

```javascript
const san = require('san')

const ComponentA = san.defineComponent({
    id: 'ComponentA', // id 标记
    template: '<div></div>'
})
const ComponentB = san.defineComponent({
    id: 'ComponentB', // id 标记
    template: '<div></div>'
})

module.exports = {
    ComponentA,
    ComponentB
}
```

# 实现原理

调用 `markExternalComponent` 时，San-SSR 会对 Node.js 中的 require 进行 hook，拦截子组件的加载。判断为子组件的 require 调用，San-SSR 会返回一个组件引用信息（specifier 和 id）。编译期间遇到组件引用信息，则会编译为外部组件的调用。

# 注意事项

require 的 hook 使用的是类似 [require-in-the-middle](https://www.npmjs.com/package/require-in-the-middle) 的方式，与 [jest](https://www.npmjs.com/package/jest) 不兼容。
